(23, NULL, 'Tron (TRX)', '', 'upload//1662274195_40e7f73193176b96f901.png', '', '<p>Tronscan Address:&nbsp; &nbsp;<a href=\"https://tronscan.org/#/token/0/transfers\" target=\"_self\">https://tronscan.org/#/token/0/transfers</a></p>\r\n\r\n<p>Tron is native token for fast, powerful and&nbsp;reliable TRON Network.</p>\r\n\r\n<p>Tron Network is very user friendly, zero transaction fees (for TRC10 tokens and 5 transactions per day from one wallet).</p>\r\n\r\n<p>Website:&nbsp; &nbsp;<a href=\"https://tron.network/\" target=\"_self\">https://tron.network</a></p>\r\n\r\n<p>Recommended wallet:&nbsp; &nbsp;<a href=\"https://www.ledger.com/\" target=\"_self\">Ledger</a>&nbsp;hardware wallet or&nbsp;<a href=\"https://www.tronlink.org\" target=\"_self\">TronLink</a></p>\r\n\r\n<p>&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', '', 32, 1, 15, '2022-09-07 08:04:58', 'admin@zerofees.excha', 0, 43),
(24, NULL, 'ZeroFees Exchange (ZFE)', '', 'upload//1662527402_a6ed8e2954abbf63cdd2.jpg', '', '<p>Token Address:&nbsp; &nbsp;Be8zNPTmyMnVqj2z7ZNSL1oYjWw6fLC5YGhmipqzbBpC</p>\r\n\r\n<p>Issued on:&nbsp; &nbsp;SOLANA Network</p>\r\n\r\n<p>Website:&nbsp; &nbsp;<a href=\"https://zerofees.exchange/\" target=\"_self\">www.ZeroFees.Exchange</a></p>\r\n\r\n<p>ZeroFees Exchange - The World&#39;s First Crypto Exchange Where You Trade With Zero Fees</p>\r\n\r\n<p>Deposited tokens are secured by Ledger hardware - in cold wallet</p>\r\n\r\n<p>Estimated appreciation against fiat dollar:&nbsp;&nbsp;&nbsp;approx. 20&nbsp;- 35% p.a.</p>\r\n\r\n<p>Risk:&nbsp; &nbsp;Moderate</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', '', 32, 1, 2, '2022-09-07 12:56:09', 'admin@zerofees.excha', 0, 33),
(25, NULL, 'TokenStore World', '', 'upload//1662532093_ca1c892f73858f61dd8b.jpg', '', '<p>Token ID:&nbsp; &nbsp;1002590</p>\r\n\r\n<p>Issued on:&nbsp; &nbsp;TRON Network&nbsp;(5 transfers per day from one wallet are&nbsp;<strong>free of network charge</strong>&nbsp;for TRC10 tokens)</p>\r\n\r\n<p>Standard:&nbsp; &nbsp;TRC10</p>\r\n\r\n<p>Website:&nbsp; &nbsp;<a href=\"https://tokenstore.world/\" target=\"_self\">www.TokenStore.World</a></p>\r\n\r\n<p>TokenStore World is ultra low-cost token store in preparation.&nbsp;This store will be specialized in renegade tokens, shitcoins, child games tokens, failed Ponzi scheme tokens, hopelessly slow and desperately clogged networks etc.</p>\r\n\r\n<p>Risk:&nbsp; &nbsp;High</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', '', 32, 1, 8, '2022-09-07 06:29:53', 'admin@zerofees.excha', 0, 40),
(26, NULL, 'USD Equivalent (USDE)', '', 'upload//1662539458_86040ba724640b83ef87.jpg', '', '<p>Token ID:&nbsp; &nbsp;1003150</p>\r\n\r\n<p>Issued on:&nbsp; &nbsp;TRON Network (5 transfers per day from one wallet are <strong>free of network charge</strong> for TRC10 tokens)</p>\r\n\r\n<p>Standard:&nbsp; &nbsp;TRC10</p>\r\n\r\n<p>Website:&nbsp; &nbsp;</p>\r\n\r\n<p>USD Equivalent is not a so-called &quot;stablecoin&quot;. That&#39;s just the equivalent of a slowly dying and the purchase power losing fiat dollar.</p>\r\n\r\n<p>Since the Federal Reserve System&#39;s inception, fiat dollar has lost more than 96% of its purchasing power.</p>\r\n\r\n<p>Note:&nbsp; &nbsp;Stakeholders&nbsp;claimed that they would support the market price of the USDE if it fell below 98.5% of the current market price.</p>\r\n\r\n<p>Recommended wallet:&nbsp; &nbsp;<a href=\"https://www.ledger.com/\" target=\"_self\">Ledger</a>&nbsp;hardware wallet or&nbsp;<a href=\"https://www.tronlink.org\" target=\"_self\">TronLink</a></p>\r\n\r\n<p>&nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', '', 32, 1, 10, '2022-09-07 08:11:10', 'admin@zerofees.excha', 0, 29),
(27, NULL, 'USD Coin (USDC)', '', 'upload//1662547742_e9193e214ef5d847caaa.png', '', '<p>Contract:&nbsp; &nbsp;TEkxiTehnzSmSe2XqrBj4w32RUN966rdz8</p>\r\n\r\n<p>Issued on:&nbsp; &nbsp;TRON Network (small network fees are applied for TRC20 tokens)</p>\r\n\r\n<p>Standard:&nbsp; &nbsp;TRC20</p>\r\n\r\n<p>Recommended wallet:&nbsp; &nbsp;<a href=\"https://www.ledger.com/\" target=\"_self\">Ledger</a>&nbsp;hardware wallet or&nbsp;<a href=\"https://www.tronlink.org\" target=\"_self\">TronLink</a></p>\r\n\r\n<p>Token Address:&nbsp; &nbsp;EPjFWdd5AufqSSqeM2qN1xzybapC8G4wEGGkZwyTDt1v</p>\r\n\r\n<p>Issued on:&nbsp; &nbsp;SOLANA Network&nbsp;(small network fees are applied for TRC20 tokens)</p>\r\n\r\n<p>Website:&nbsp; &nbsp;<a href=\"https://www.centre.io/usdc\" target=\"_self\">https://www.centre.io/usdc</a></p>\r\n\r\n<p>WARNING!&nbsp; &nbsp;As officially announced, the USDC project administrators no longer hold 100.00% of fiat dollar reserves</p>\r\n\r\n<p>WARNING!&nbsp; &nbsp;USDC project administrators block addresses listed on a OFAC list created by&nbsp;the U.S. administration</p>\r\n\r\n<p>&nbsp; &nbsp;&nbsp;</p>\r\n', '', '', '', '', 32, 1, 11, '2022-09-07 08:08:03', 'admin@zerofees.excha', 0, 30),
(28, NULL, 'Tether USD (USDT)', '', 'upload//1662549199_3a5c72b04b283af02312.png', '', '<p>Contract:&nbsp; &nbsp;TR7NHqjeKQxGTCi8q8ZY4pL8otSzgjLj6t</p>\r\n\r\n<p>Issued on:&nbsp; &nbsp;TRON Network&nbsp;(small network fees are applied for TRC20 tokens)</p>\r\n\r\n<p>Standard:&nbsp; &nbsp;TRC20</p>\r\n\r\n<p>Website:&nbsp; &nbsp;<a href=\"https://tether.to/\" target=\"_self\">https://tether.to/</a></p>\r\n\r\n<p>Recommended wallet:&nbsp; &nbsp;<a href=\"https://www.ledger.com/\" target=\"_self\">Ledger</a>&nbsp;hardware wallet or&nbsp;<a href=\"https://www.tronlink.org\" target=\"_self\">TronLink</a></p>\r\n\r\n<p>WARNING!&nbsp; &nbsp;As officially announced, the USDT&nbsp;project administrators no longer hold 100.00% of fiat dollar reserves</p>\r\n\r\n<p>&nbsp; &nbsp;</p>\r\n', '', '', '', '', 32, 1, 12, '2022-09-07 08:06:52', 'admin@zerofees.excha', 0, 31),
(29, NULL, 'TestBit (TEST)', '', 'upload//1662625445_c9179b02eaecb8f73b63.jpg', '', '<p>TestBit is a token specifically <strong>designed for testing purposes for new users</strong> who are not very familiar with the crypto ecosystem.</p>\r\n\r\n<p>TestBit (TEST)<strong> is not real token,&nbsp;not even in the blockchain</strong>.&nbsp;And that&#39;s why they can&#39;t even be withdrawn.</p>\r\n\r\n<p>TestBit (TEST)&nbsp;has no real value.&nbsp;Its purpose is strictly for testing purposes for&nbsp;newbies.</p>\r\n\r\n<p>TestBit (TEST) is test token and is <strong>NOT&nbsp;representation of value</strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', '', 32, 1, 29, '2022-09-08 06:23:56', 'admin@zerofees.excha', 0, 44),
(30, NULL, 'Test Market (TMARK)', '', 'upload//1662626091_6963bcb79075b6d5bbaa.jpg', '', '<p>Test Market (TMARK)&nbsp;is a token specifically <strong>designed for testing purposes for new users</strong> who are not very familiar with the crypto ecosystem.</p>\r\n\r\n<p>Test Market (TMARK)<strong> is not real token,&nbsp;not even in the blockchain</strong>.&nbsp;And that&#39;s why they can&#39;t even be withdrawn.</p>\r\n\r\n<p>Test Market (TMARK)&nbsp;has no real value.&nbsp;Its purpose is strictly for testing purposes for&nbsp;newbies.</p>\r\n\r\n<p>Test Market (TMARK) is test token and is <strong>NOT&nbsp;representation of value</strong>.<br />\r\n<br />\r\n&nbsp;&nbsp;</p>\r\n', '', '', '', '', 32, 1, 30, '2022-09-08 06:24:58', 'admin@zerofees.excha', 0, 45);
